import {Link} from 'react-router-dom'

const Navbar = () => {
    return ( 
        <header>
        <nav className="navbar">
        <h1>Hobnob</h1>
        
        <div className="links"> 
        <Link to="/Login">Login</Link>
        <Link to="/Signup">Signup</Link> 
        </div>

        </nav>
        </header>
     );
}
 
export default Navbar;
